import React from 'react'
import Logo from "../assets/RecLogo.png"
function Header() {
  return (
    <div className='bg-orange-100 w-full flex'>
      <img alt="BbyCakes Logo"src={Logo} style={{height:'200px'}}/>
    </div>
  )
}

export default Header
